  \"2015-10-29T05:53:38.035231\",\n\t\"name\": \"state-park-facility-points\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The New York State Office of Parks, Recreation
  and Historic Preservation (OPRHP) oversees more than 214 state parks and historic
  sites, encompassing nearly 335,000 acres, that are visited by 60 million people
  annually. These facilities contribute to the economic vitality and quality of life
  of local communities and directly support New Yorku2019s tourism industry. Parks
  also provide a place for families and children to be active and exercise, promoting
  healthy lifestyles. The agency is responsible for the operation and stewardship
  of the state park system as well as advancing a statewide parks, historic preservation,
  and open space mission.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
